import React, {useState, useEffect} from 'react';
import { View, Text, Button } from 'react-native';

export default function Login({navigation}) {
  return (
    <View>
      <Text>Login Page</Text>
      <Button
        title="go to Home"
        onPress={() => navigation.navigate("Home")}
      />
    </View>
  )
}
